import React from "react";

import "../styles/Signup.css";

class Signup extends React.Component {
  constructor() {
    super();
    this.state = {
      username: "",
      email: "",
      password: ""
    };
  }

  render() {
    return <h1>hello world</h1>;
  }
}

export default Signup;
